import React from 'react'
import Data from '../assets/ServiceData';
import ServiceCard from './ServiceCard';

function Service() {
  return (

        Data.map((currEle)=>{
            <ServiceCard title={currEle.title} description={currEle.description} image={currEle.image}/>
        })

  )
}

export default Service
